import { BannerWrapper, Logo, ScrollingText, ScrollingText2, SocialLogo, SocialRow, SocialRowT, Socials, Wrapper } from "./styled";
import bg from "../../images/background.png";
import tt from "../../images/icons/4362958_tiktok_logo_social media_icon.svg"
import fb from "../../images/icons/834722_facebook_icon.svg"
import msg from "../../images/icons/7086697_messenger_facebook messenger_messenger logo_icon.svg"
import ig from "../../images/icons/6636566_instagram_social media_social network_icon.svg"
import { Tiles } from "./Tiles";

export const Top = () => {
    const text = " Renowacja felg, CNC, Malowanie proszkowe, Piaskowanie ✦   ";
  return (
    <>
    <Wrapper bg={bg}>
      <Logo src={logo} />
      <BannerWrapper>
        <ScrollingText>{text + text + "  "}</ScrollingText>
        <ScrollingText2>{text + text + "  "}</ScrollingText2>
      </BannerWrapper>
    </Wrapper>
    <Tiles/>

<Socials><SocialRowT>Zobacz materiały z naszych realizacji:</SocialRowT>
<SocialRow>TikTok <SocialLogo src={tt} alt="TikTok" /></SocialRow>
    <SocialRow>Facebook <SocialLogo src={fb} alt="Facebook" /></SocialRow>
      <SocialRow>Instagram <SocialLogo src={ig} alt="Instagram" /></SocialRow>
</Socials>

